import React, { useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import Bredcrumb from 'src/components/core/Bredcrumb';
import TableBody from 'src/components/ecommerce/DefaultList/TableBody';
import TableHeader from 'src/components/ecommerce/DefaultList/TableHeader';
import Pagination from 'src/components/ecommerce/products/pagination';
import { getCategories } from 'src/features/pcategory/categorySlice';

const CategoryList = () => {
    const dispatch = useDispatch();
    useEffect(() => {
        dispatch(getCategories());
    },[]);

    const categoryState = useSelector((state) => state.categories.categories);

  return (
    <div className="content"> 
        <div className="container-fluid">

            <Bredcrumb title="Categories"/>

            <div className="row">
                <div className="col-12">
                    <div className="card">
                        <div className="card-body">
                            <div className="row mb-2">
                                <div className="col-lg-8">
                                    <form className="form-inline">
                                        <div className="form-group mb-2">
                                            <label for="inputPassword2" className="sr-only">Search</label>
                                            <input type="search" className="form-control" id="inputPassword2" placeholder="Search..." />
                                        </div>
                                    </form>                            
                                </div>
                                <div className="col-lg-4">
                                    <div className="text-lg-right">
                                        <button type="button" className="btn btn-danger waves-effect waves-light mb-2 mr-2"><i className="mdi mdi-basket mr-1"></i> Add New Category</button>
                                        <button type="button" className="btn btn-light waves-effect mb-2">Export</button>
                                    </div>
                                </div>
                            </div>

                            <div className="table-responsive">
                                <table className="table table-centered table-nowrap mb-0">
                                    <TableHeader />
                                    <TableBody />
                                </table>
                            </div>

                            <Pagination />
                        </div> 
                    </div> 
                </div> 
            </div>


        </div> 
    </div>
  )
}

export default CategoryList
